import React from 'react';
import { NavLink } from 'react-router-dom';
import { connect } from 'react-redux';

import LinkItem from '../components/LinkItem/LinkItem'

import styles from './DefaultPage.module.css'

function render( { doctors } ) {
  return (
    <div className={styles.page}>
      <ul className={styles.list}>
        {doctors.map(doctor =>
          <NavLink key={doctor.id} to={`doctor/${doctor.id}/schedule`} >
            <LinkItem
              key={doctor.id}
              index={doctor.id}
              text={doctor.lastName + ' ' + doctor.firstName + ' ' + doctor.secondName} />
          </NavLink>)
        }
      </ul>
    </div>
  );
}


const mapStateToProps = state => ({departments: state.emias.doctors});

export default connect(mapStateToProps)(render);
